import React from 'react';
import { Box, Container, Typography, Grid, Paper } from '@mui/material';

const Skills = () => {
  const skillCategories = [
    {
      title: 'Languages',
      skills: ['Java', 'Python', 'Golang', 'C++', 'JavaScript', 'TypeScript', 'SQL'],
    },
    {
      title: 'AWS Services',
      skills: ['EC2', 'Lambda', 'S3', 'DynamoDB', 'RDS', 'CloudFormation', 'CloudWatch'],
    },
    {
      title: 'Data Analytics & Processing',
      skills: ['Numpy', 'Pandas', 'Sci-Kit Learn', 'MySQL', 'PostgreSQL', 'MongoDB'],
    },
    {
      title: 'AI & Machine Learning',
      skills: ['PyTorch', 'TensorFlow', 'Langchain', 'Machine Learning', 'NLP', 'CNN'],
    },
    {
      title: 'Frameworks',
      skills: ['SpringBoot', 'Django', 'Flask', 'React', 'Angular', 'FastAPI'],
    },
    {
      title: 'Tools & Technologies',
      skills: ['Docker', 'Kubernetes', 'Kafka', 'Git', 'Jenkins', 'JIRA', 'Grafana'],
    },
  ];

  return (
    <Box
      id="skills"
      sx={{
        py: 8,
        backgroundColor: 'background.default',
      }}
    >
      <Container>
        <Typography
          variant="h2"
          sx={{
            mb: 6,
            textAlign: 'center',
            color: 'text.primary',
          }}
        >
          Skills
        </Typography>
        <Grid container spacing={4}>
          {skillCategories.map((category, index) => (
            <Grid item xs={12} md={6} key={index}>
              <Paper
                elevation={3}
                sx={{
                  p: 3,
                  height: '100%',
                  backgroundColor: 'background.paper',
                  transition: 'transform 0.2s',
                  '&:hover': {
                    transform: 'translateY(-5px)',
                  },
                }}
              >
                <Typography
                  variant="h5"
                  color="primary"
                  gutterBottom
                  sx={{ mb: 2 }}
                >
                  {category.title}
                </Typography>
                <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                  {category.skills.map((skill, idx) => (
                    <Box
                      key={idx}
                      sx={{
                        px: 2,
                        py: 1,
                        borderRadius: 1,
                        backgroundColor: 'background.default',
                        color: 'text.primary',
                      }}
                    >
                      {skill}
                    </Box>
                  ))}
                </Box>
              </Paper>
            </Grid>
          ))}
        </Grid>
      </Container>
    </Box>
  );
};

export default Skills;
